import logo from './logo.svg';
import catgirl from './Gay-Cat.png'
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <div align="center">Gay Catgirl</div>
	      <div align="center"> <img src="./Gay-Cat.png" alt="Gay Cat"/></div>
      </header>
    </div>
  );
}

export default App;
